    (csv/parse-csv (slurp file))))

; Files
(def vote_result_sample (take-csv "bayesian-ballot/data/vote_result_sample.csv"))
(def vote_result_1521 (take-csv "bayesian-ballot/data/vote_result_1521.csv"))

